function searchKeydown(e) {
    if (e.key === 'Escape') {
        e.target.value = '';
        hideSearch();
    }
}
function search(e) {
    let q = e.target.value;
    if (!q || q.trim().length === 0) {
        hideSearch();
    } else {
        q = q.toLowerCase();
        let res = runSearch(q);
        showSearch(res, q);
    }
}
function runSearch(q) {
    let results = [];
    q = q.toLowerCase();
    for (let n of NODES) {
        if (n[0].toLowerCase().includes(q)) {
            results.push(n);
        }
    }

    results.sort((n1, n2) => {
        let a = n1[0].replace(/ \((Function|Variable|Macro|Type Specifier|Type)\)$/, '').toLowerCase();
        let b = n2[0].replace(/ \((Function|Variable|Macro|Type Specifier|Type)\)$/, '').toLowerCase();

        if (a === q) {
            return -1;
        }
        if (b === q) {
            return 1;
        }
        // If the search term is at the start of the item, it is more relevant
        if (a.startsWith(q) && !b.startsWith(q)) {
            return -1;
        } 
        if (!a.startsWith(q) && b.startsWith(q)) {
            return 1;
        }

        // If the search term appears earlier in the item, it is more relevant
        if (a.indexOf(q) < b.indexOf(q)) {
            return -1;
        } else if (a.indexOf(q) > b.indexOf(q)) {
            return 1;
        }

        return 0;
    });
    return results;

}
function showSearch(results, q) {
    let drop = document.getElementById('search__drop');
    drop.style.display = 'block';
    let html = '';

    if (results.length === 0) {
        html = '<div>Nothing found, sorry.</div>';
    }
    var qre = new RegExp('('+q.replace(/[.*+?^${}()|[\]\\]/g, '\\$&')+')', 'gi');
    for (let r of results) {
        let text = r[0].replace(qre, '<mark>$1</mark>');
        html += `<a class="search__res" href="${r[1]}.html">${text}</a>`;
    }
    drop.innerHTML = html;
    // search dropdown -> hide on outside click
    window.onclick = function(e){
        if (e.target && !e.target.matches('#search__drop')) {
            hideSearch();
        }
    };
}
function hideSearch() {
    document.getElementById('search__drop').style.display = 'none';
    window.onclick = null;
}
function scrollSidenavToCurrentPage() {
    let scrEl = document.getElementsByClassName('sidenav__main')[0];
    let page = getCurrentPage();
    let navEl = document.querySelector(`a[href="${page}"]`);
    if (navEl && scrEl) {
        let navElTop = navEl.getBoundingClientRect().top;
        let scrElTop = scrEl.getBoundingClientRect().top;
        let scrElH = scrEl.getBoundingClientRect().height;
        scrEl.scrollTop = Math.max(0, scrEl.scrollTop + navElTop - scrElTop - scrElH / 2);
    }
}
function getCurrentPage() {
    let pth = window.location.href.substring(window.location.href.lastIndexOf('/') + 1);
    if (pth.indexOf('#') !== -1) {
        pth = pth.substring(0, pth.indexOf('#'));
    }
    return pth;
}

function toggleTheme() {
    if (window._theme === 'dark') {
        window._theme = 'light';
        window.localStorage.setItem('clcs-theme', 'light');
        document.documentElement.removeAttribute("data-theme");
    } else {
        window._theme = 'dark';
        window.localStorage.setItem('clcs-theme', 'dark');
        document.documentElement.setAttribute("data-theme", "dark");
    }
}
// highlight current page in sidebar nav
(() => {
    let currentPath = getCurrentPage();
    let navEl = document.querySelector(`.sidenav__main a[href="${currentPath}"]`);
    if (navEl) {
        navEl.classList.add('active');
        // if currently active element is not scrolled into view in sidebar, scroll into view
        let scrEl = document.getElementsByClassName('sidenav__main')[0];
        let navElTop = navEl.getBoundingClientRect().top;
        let scrElTop = scrEl.getBoundingClientRect().top;
        let scrElH = scrEl.getBoundingClientRect().height;
        let isVisible = navElTop > scrElTop && navElTop < (scrElTop + scrElH);
        if (!isVisible) {
            scrollSidenavToCurrentPage();
        }
    }
})();

// syntax highlighting
(() => {
    for (let el of document.getElementsByTagName('code')) {
        el.innerHTML = el.innerHTML
            .replace(/<br>/g, '\n')
            .replace(/<i\/?>/g, '')
            .replace(/<tt\/?>/g, '');
        HighlightLisp.highlight_element(el);
    }
})();
